I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been able to get the contents of the clipboard using the `clipboard` crate, but I'm having trouble figuring out how to use the elevenlabs.io api to read the text aloud.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Url;
use serde::Deserialize;
use std::error::Error;

#[derive(Deserialize)]
struct ElevenLabsResponse {
    audio_url: String,
}

async fn read_clipboard_aloud() -> Result<(), Box<dyn Error>> {
    let text = ClipboardProvider::new().get_contents()?;
    let url = Url::parse("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")?;
    let client = reqwest::Client::new();
    let response = client
        .post(url)
        .header("Content-Type", "application/json")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<ElevenLabsResponse>()
        .await?;

    // How do I play the audio from the response?
    println!("Audio URL: {}", response.audio_url);

    Ok(())
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    read_clipboard_aloud().await?;

    Ok(())
}
```

I'm not sure how to play the audio from the response. I've tried using the `rodio` crate to play the audio, but I'm not sure how to convert the audio URL from the response into a format that `rodio` can use.

Any help would be greatly appreciated!

